Text:
@snaggletooth

Kan du inte läsa engelska? Jag har seedat ut den här till 100 % x 7,5 gånger storleken. Hade tio seedare när jag lämnade den. Att DOM sedan INTE seedar efter sig kan inte jag ansvara för, gaphals.

Andra har provat att bränna den ändå och det går tydligen bra. Den saknade 0,1% är tydligen på disc 2 vilken bara innehåller en massa dokumentärer om hur filmen gjordes. Är de nödvändiga för dig, köp filmen.
